import React from "react";
import { Carousel } from "react-bootstrap";
import tuto from "../assets/tuto.jpg";
import forum from "../assets/forum.jpg";
import projet from "../assets/projet.jpg";
const MyCarousel = () => {
  return (
    <Carousel interval={1000}>
      <Carousel.Item>
        <img src={forum} class="card-img-top" alt="..." />
      </Carousel.Item>
      <Carousel.Item>
        <img className="w-100 mt-5" src={projet} alt="Second slide" />
      </Carousel.Item>
      <Carousel.Item>
        <img className="w-100 mt-5" src={tuto} alt="Third slide" />
      </Carousel.Item>
    </Carousel>
  );
};

export default MyCarousel;
